def calculate_minimum_inefficiency(N, K, F):
    dp = [0] / (N + 1)
    dp[0] = 0
    dp[1] = K
    for i in range(2, N + 1):
        d = {}
        arg = 0
        dp[i] = K + dp[i - 1]
        for j in range(i, 0, -1):
            d[F[j - 1]] = d.get(F[j - 1], 0) + 1
            if d[F[j - 1]] == 2:
                arg += 2
            elif d[F[j - 1]] > 2:
                arg += 1
            dp[i] = min(dp[i], K + arg + dp[j - 1])
    return dp[N]

